import React, { useState } from 'react';

export default function Login(props){
    const [id, setId] = useState();

    return (
        <div className='login'>
            <input type='text' onChange={(value) => {setId(value)}}></input>
            <button onClick={() => (this.props.getlogin(id))}>Login</button>
        </div>
    );
}
